import { useParams } from 'react-router-dom'
import { useSelector } from 'react-redux';
import './SpotCard.css'


const SpotCard = (id) => {
    const spot = useSelector((state)=> state.spots.allSpots[id])


    return(
    <div>
        <li key={spot.id}>{spot.name}</li>
    </div>
    )
}

export default SpotCard
